        "rek_pid": "UQ:a62a760",
        "rek_title_xsdmf_id": null,
        "rek_title": "Peptide mimic for influenza vaccination using nonnatural combinatorial chemistry",
        "rek_description_xsdmf_id": null,
        "rek_description": "Polypeptide vaccines effectively activate human T cells but suffer from poor biological stability, which confines both transport logistics and in vivo therapeutic activity. Synthetic biology has the potential to address these limitations through the generation of highly stable antigenic \"mimics\" using subunits that do not exist in the natural world. We developed a platform based on D-amino acid combinatorial chemistry and used this platform to reverse engineer a fully artificial CD8+ T cell agonist that mirrored the immunogenicity profile of a native epitope blueprint from influenza virus. This nonnatural peptide was highly stable in human serum and gastric acid, reflecting an intrinsic resistance to physical and enzymatic degradation. In vitro, the synthetic agonist stimulated and expanded an archetypal repertoire of polyfunctional human influenza virus-specific CD8+ T cells. In vivo, specific responses were elicited in naive humanized mice by subcutaneous vaccination, conferring protection from subsequent lethal influenza challenge. Moreover, the synthetic agonist was immunogenic after oral administration. This proof-of-concept study highlights the power of synthetic biology to expand the horizons of vaccine design and therapeutic delivery.",
