        "rek_title": "Global statistics on alcohol, tobacco and illicit drug use: 2017 status report",
        "rek_description_xsdmf_id": null,
        "rek_description": "This review provides an up-to-date curated source of information on alcohol, tobacco, and illicit drug use and their associated mortality and burden of disease. Limitations in the data are also discussed, including how these can be addressed in the future.<br \/><br \/>Online data sources were identified through expert review. Data were mainly obtained from the World Health Organization, United Nations Office on Drugs and Crime, and Institute for Health Metrics and Evaluation.<br \/><br \/>In 2015, the estimated prevalence among the adult population was 18.3% for heavy episodic alcohol use (in the past 30 days); 15.2% for daily tobacco smoking; and 3.8%, 0.77%, 0.37%, and 0.35% for past-year cannabis, amphetamine, opioid, and cocaine use, respectively. European regions had the highest prevalence of heavy episodic alcohol use and daily tobacco use. The age-standardised prevalence of alcohol dependence was 843.2 per 100,000 people; for cannabis, opioids, amphetamines and cocaine dependence it was 259.3, 220.4, 86.0 and 52.5 per 100,000 people, respectively. High-Income North America region had among the highest rates of cannabis, opioid, and cocaine dependence. Attributable disability-adjusted life-years (DALYs) were highest for tobacco (170.9 million DALYs), followed by alcohol (85.0 million) and illicit drugs (27.8 million). Substance-attributable mortality rates were highest for tobacco (110.7 deaths per 100,000 people), followed by alcohol and illicit drugs (33.0, and 6.9 deaths per 100,000 people, respectively). Attributable age-standardised mortality rates and DALYs for alcohol and illicit drugs were highest in Eastern Europe; attributable age-standardised tobacco mortality rates and DALYs were highest in Oceania.<br \/><br \/>In 2015 alcohol and tobacco use between them cost the human population more than a quarter of a billion disability-adjusted life years, with illicit drugs costing a further tens of millions. Europeans proportionately suffered more but in absolute terms the mortality rate was greatest in low and middle income countries with large populations and where the quality of data was more limited. Better standardised and rigorous methods for data collection, collation and reporting are needed to assess more accurately the geographical and temporal trends in substance use and its disease burden.",
