        "rek_date_xsdmf_id": 6386,
        "rek_date": "2014-03-17T00:00:00Z",
        "rek_object_type_xsdmf_id": 3674,
        "rek_object_type": 3,
        "rek_depositor_xsdmf_id": 7578,
        "rek_depositor": 33350,
        "rek_created_date_xsdmf_id": 3677,
        "rek_created_date": "2017-03-07T00:08:12Z",
        "rek_updated_date_xsdmf_id": 3678,
        "rek_updated_date": "2018-05-18T03:58:29Z",
        "rek_file_downloads": 0,
        "rek_citation": "<a class=\"author_id_link\" title=\"Browse by Author ID for Ho, Van Thi Thuy\" href=\"\/list\/author_id\/1241987\/\">Ho, Van Thi Thuy<\/a>, <a class=\"citation_author_name\" title=\"Browse by Author Name for Zhao, Jian\" href=\"\/list\/author\/Zhao%2C+Jian\/\">Zhao, Jian<\/a> and <a class=\"citation_author_name\" title=\"Browse by Author Name for Fleet, Graham\" href=\"\/list\/author\/Fleet%2C+Graham\/\">Fleet, Graham<\/a> (<span class=\"citation_date\">2014<\/span>) <a class=\"citation_title\" title=\"Click to view Journal Article: Yeasts are essential for cocoa bean fermentation\" href=\"\/view\/UQ:499781\">Yeasts are essential for cocoa bean fermentation<\/a>. <i><span class=\"citation_journal_name\">International Journal of Food Microbiology<\/span><\/i>, <i><span class=\"citation_volume_number\">174<\/span><\/i>  <span class=\"citation_start_page\">72<\/span>-<span class=\"citation_end_page\">87<\/span>. doi:<span class=\"citation_doi\">10.1016\/j.ijfoodmicro.2013.12.014<\/span>",
        "rek_genre_xsdmf_id": 7207,
        "rek_genre": "Journal Article",
        "rek_genre_type_xsdmf_id": null,
        "rek_genre_type": null,
        "rek_formatted_title_xsdmf_id": null,
        "rek_formatted_title": null,
        "rek_formatted_abstract_xsdmf_id": 11442,
        "rek_formatted_abstract": "Cocoa beans (<em>Theobroma cacao<\/em>) are the major raw material for chocolate production and fermentation of the beans is essential for the development of chocolate flavor precursors. In this study, a novel approach was used to determine the role of yeasts in cocoa fermentation and their contribution to chocolate quality. Cocoa bean fermentations were conducted with the addition of 200 ppm Natamycin to inhibit the growth of yeasts, and the resultant microbial ecology and metabolism, bean chemistry and chocolate quality were compared with those of normal (control) fermentations. The yeasts <em>Hanseniaspora guilliermondii<\/em>, <em>Pichia kudriavzevii<\/em> and <em>Kluyveromyces marxianus<\/em>, the lactic acid bacteria <em>Lactobacillus plantarum<\/em> and <em>Lactobacillus fermentum<\/em> and the acetic acid bacteria <em>Acetobacter pasteurianus<\/em> and <em>Gluconobacter frateurii<\/em> were the major species found in the control fermentation. In fermentations with the presence of Natamycin, the same bacterial species grew but yeast growth was inhibited. Physical and chemical analyses showed that beans fermented without yeasts had increased shell content, lower production of ethanol, higher alcohols and esters throughout fermentation and lesser presence of pyrazines in the roasted product. Quality tests revealed that beans fermented without yeasts were purplish-violet in color and not fully brown, and chocolate prepared from these beans tasted more acid and lacked characteristic chocolate flavor. Beans fermented with yeast growth were fully brown in color and gave chocolate with typical characters which were clearly preferred by sensory panels. Our findings demonstrate that yeast growth and activity were essential for cocoa bean fermentation and the development of chocolate characteristics.",
