        "rek_file_downloads": 0,
        "rek_citation": "<a class=\"author_id_link\" title=\"Browse by Author ID for Wilks, Matti\" href=\"\/list\/author_id\/89083\/\">Wilks, Matti<\/a> and <a class=\"author_id_link\" title=\"Browse by Author ID for Phillips, Clive J. C.\" href=\"\/list\/author_id\/2722\/\">Phillips, Clive J. C.<\/a> (<span class=\"citation_date\">2017<\/span>) <a class=\"citation_title\" title=\"Click to view Journal Article: Attitudes to in vitro meat: a survey of potential consumers in the United States\" href=\"\/view\/UQ:483043\">Attitudes to in vitro meat: a survey of potential consumers in the United States<\/a>. <i><span class=\"citation_journal_name\">PLoS One<\/span><\/i>, <i><span class=\"citation_volume_number\">12<\/span><\/i> <span class=\"citation_issue_number\">2<\/span>: . doi:<span class=\"citation_doi\">10.1371\/journal.pone.0171904<\/span>",
        "rek_genre_xsdmf_id": 7207,
        "rek_genre": "Journal Article",
        "rek_genre_type_xsdmf_id": null,
        "rek_genre_type": null,
        "rek_formatted_title_xsdmf_id": 11438,
        "rek_formatted_title": "Attitudes to <em>in vitro<\/em> meat: a survey of potential consumers in the United States",
        "rek_formatted_abstract_xsdmf_id": 11442,
        "rek_formatted_abstract": "Positivity towards meat consumption remains strong, despite evidence of negative environmental and ethical outcomes. Although awareness of these repercussions is rising, there is still public resistance to removing meat from our diets. One potential method to alleviate these effects is to produce <em>in vitro<\/em> meat: meat grown in a laboratory that does not carry the same environmental or ethical concerns. However, there is limited research examining public attitudes towards <em>in vitro<\/em> meat, thus we know little about the capacity for it be accepted by consumers. This study aimed to examine perceptions of<em> in vitro<\/em> meat and identify potential barriers that might prevent engagement. Through conducting an online survey with US participants, we identified that although most respondents were willing to try <em>in vitro<\/em> meat, only one third were definitely or probably willing to eat <em>in vitro<\/em> meat regularly or as a replacement for farmed meat. Men were more receptive to it than women, as were politically liberal respondents compared with conservative ones. Vegetarians and vegans were more likely to perceive benefits compared to farmed meat, but they were less likely to want to try it than meat eaters. The main concerns were an anticipated high price, limited taste and appeal and a concern that the product was unnatural. It is concluded that people in the USA are likely to try <em>in vitro<\/em> meat, but few believed that it would replace farmed meat in their diet.",
