        "rek_formatted_abstract_xsdmf_id": 11442,
        "rek_formatted_abstract": "Background<br \/><br \/>Exposure to ambient air pollution increases morbidity and mortality, and is a leading contributor to global disease burden. We explored spatial and temporal trends in mortality and burden of disease attributable to ambient air pollution from 1990 to 2015 at global, regional, and country levels.<br \/><br \/>Methods<br \/><br \/>We estimated global population-weighted mean concentrations of particle mass with aerodynamic diameter less than 2&middot;5 &mu;m (PM<sub>2&middot;5<\/sub>) and ozone at an approximate 11 km\u2008&times;\u200811 km resolution with satellite-based estimates, chemical transport models, and ground-level measurements. Using integrated exposure&ndash;response functions for each cause of death, we estimated the relative risk of mortality from ischaemic heart disease, cerebrovascular disease, chronic obstructive pulmonary disease, lung cancer, and lower respiratory infections from epidemiological studies using non-linear exposure&ndash;response functions spanning the global range of exposure.<br \/><br \/>Findings<br \/><br \/>Ambient PM<sub>2&middot;5<\/sub> was the fifth-ranking mortality risk factor in 2015. Exposure to PM<sub>2&middot;5<\/sub> caused 4&middot;2 million (95% uncertainty interval [UI] 3&middot;7 million to 4&middot;8 million) deaths and 103&middot;1 million (90&middot;8 million 115&middot;1 million) disability-adjusted life-years (DALYs) in 2015, representing 7&middot;6% of total global deaths and 4&middot;2% of global DALYs, 59% of these in east and south Asia. Deaths attributable to ambient PM<sub>2&middot;5<\/sub> increased from 3&middot;5 million (95% UI 3&middot;0 million to 4&middot;0 million) in 1990 to 4&middot;2 million (3&middot;7 million to 4&middot;8 million) in 2015. Exposure to ozone caused an additional 254\u2008000 (95% UI 97\u2008000&ndash;422\u2008000) deaths and a loss of 4&middot;1 million (1&middot;6 million to 6&middot;8 million) DALYs from chronic obstructive pulmonary disease in 2015.<br \/><br \/>Interpretation<br \/><br \/>Ambient air pollution contributed substantially to the global burden of disease in 2015, which increased over the past 25 years, due to population ageing, changes in non-communicable disease rates, and increasing air pollution in low-income and middle-income countries. Modest reductions in burden will occur in the most polluted countries unless PM2&middot;5 values are decreased substantially, but there is potential for substantial health benefits from exposure reduction.",
