        "rek_pid": "UQ:545613",
        "rek_title_xsdmf_id": 10588,
        "rek_title": "Global warming and recurrent mass bleaching of corals",
        "rek_description_xsdmf_id": 11441,
        "rek_description": "During 2015-2016, record temperatures triggered a pan-tropical episode of coral bleaching, the third global-scale event since mass bleaching was first documented in the 1980s. Here we examine how and why the severity of recurrent major bleaching events has varied at multiple scales, using aerial and underwater surveys of Australian reefs combined with satellite-derived sea surface temperatures. The distinctive geographic footprints of recurrent bleaching on the Great Barrier Reef in 1998, 2002 and 2016 were determined by the spatial pattern of sea temperatures in each year. Water quality and fishing pressure had minimal effect on the unprecedented bleaching in 2016, suggesting that local protection of reefs affords little or no resistance to extreme heat. Similarly, past exposure to bleaching in 1998 and 2002 did not lessen the severity of bleaching in 2016. Consequently, immediate global action to curb future warming is essential to secure a future for coral reefs.",
