        "rek_genre_xsdmf_id": 7207,
        "rek_genre": "Journal Article",
        "rek_genre_type_xsdmf_id": null,
        "rek_genre_type": null,
        "rek_formatted_title_xsdmf_id": null,
        "rek_formatted_title": null,
        "rek_formatted_abstract_xsdmf_id": 11442,
        "rek_formatted_abstract": "Human Protein Reference Database (HPRD) is an object database that integrates a wealth of information relevant to the function of human proteins in health and disease. Data pertaining to thousands of protein-protein interactions, posttranslational modifications, enzyme\/substrate relationships, disease associations, tissue expression, and subcellular localization were extracted from the literature for a nonredundant set of 2750 human proteins. Almost all the information was obtained manually by biologists who read and interpreted &gt;300,000 published articles during the annotation process. This database, which has an intuitive query interface allowing easy access to all the features of proteins, was built by using open source technologies and will be freely available at http:\/\/www.hprd.org to the academic community. This unified bioinformatics platform will be useful in cataloging and mining the large number of proteomic interactions and alterations that will be discovered in the postgenomic era.<br \/>",
