        "rek_citation": "<a class=\"citation_author_name\" title=\"Browse by Author Name for Spittle, Alicia J.\" href=\"\/list\/author\/Spittle%2C+Alicia+J.\/\">Spittle, Alicia J.<\/a>, <a class=\"citation_author_name\" title=\"Browse by Author Name for Brown, Nisha C.\" href=\"\/list\/author\/Brown%2C+Nisha+C.\/\">Brown, Nisha C.<\/a>, <a class=\"citation_author_name\" title=\"Browse by Author Name for Doyle, Lex W.\" href=\"\/list\/author\/Doyle%2C+Lex+W.\/\">Doyle, Lex W.<\/a>, <a class=\"author_id_link\" title=\"Browse by Author ID for Boyd, Roslyn N.\" href=\"\/list\/author_id\/15010\/\">Boyd, Roslyn N.<\/a>, <a class=\"citation_author_name\" title=\"Browse by Author Name for Hunt, Rod W.\" href=\"\/list\/author\/Hunt%2C+Rod+W.\/\">Hunt, Rod W.<\/a>, <a class=\"citation_author_name\" title=\"Browse by Author Name for Bear, Merilyn\" href=\"\/list\/author\/Bear%2C+Merilyn\/\">Bear, Merilyn<\/a> and <a class=\"citation_author_name\" title=\"Browse by Author Name for Inder, Terrie E.\" href=\"\/list\/author\/Inder%2C+Terrie+E.\/\">Inder, Terrie E.<\/a> (<span class=\"citation_date\">2008<\/span>) <a class=\"citation_title\" title=\"Click to view Journal Article: Quality of general movements is related to white matter pathology in very preterm infants\" href=\"\/view\/UQ:182957\">Quality of general movements is related to white matter pathology in very preterm infants<\/a>. <i><span class=\"citation_journal_name\">Pediatrics<\/span><\/i>, <i><span class=\"citation_volume_number\">121<\/span><\/i> <span class=\"citation_issue_number\">5<\/span>: <span class=\"citation_start_page\">e1184<\/span>-<span class=\"citation_end_page\">e1189<\/span>. doi:<span class=\"citation_doi\">10.1542\/peds.2007-1924<\/span>",
        "rek_genre_xsdmf_id": 7207,
        "rek_genre": "Journal Article",
        "rek_genre_type_xsdmf_id": null,
