        "rek_formatted_title_xsdmf_id": null,
        "rek_formatted_title": null,
        "rek_formatted_abstract_xsdmf_id": 11442,
        "rek_formatted_abstract": "<b>Objective:<\/b> Preterm infants are at an increased risk for abnormalities of general movements, which predict subsequent poor neurodevelopmental outcome. The cerebral lesion that predisposes the preterm infant to abnormal general movements remains unknown. The objective of this study was to determine the association between MRI-defined cerebral abnormalities and general movements at 1 and 3 months' corrected age in infants who were born very preterm.<br \/><br \/><b>Methods:<\/b> Eighty-six preterm infants (&lt;30 weeks' gestation) were prospectively recruited and underwent brain MRI at term-equivalent age to investigate the relationship between qualitative white and gray matter pathology and abnormality of general movements. Standardized videotaped recordings of general movements were obtained at 1 and 3 months postterm (&plusmn;1 week) and scored without knowledge of the MRI findings. At 1 month corrected age, general movements of a writhing character were classified as normal or abnormal (poor repertoire, cramped synchronized, or chaotic). At 3 months' corrected age, fidgety general movements were classified as present or absent.<br \/><br \/><b>Results:<\/b>&nbsp; At 1 month, 53 (62%) infants had abnormal general movements, 46 of whom had poor repertoire general movements and 7 of whom had cramped synchronized general movements. At 3 months, 23 (25%) infants had absent fidgety movements. At both 1 and 3 months of age, consistently abnormal general movement classifications were related to increasing white matter abnormality on MRI. In contrast, there were no significant relationships between general movement classifications and gray matter abnormalities, either individually or in total.<br \/><b><br \/>Conclusion:<\/b>&nbsp; The significant relationships between general movements at 1 and 3 months and cerebral white matter abnormalities on MRI in the very preterm infant support the concept that abnormal general movements reflect white matter injury.<br \/>",
