        "rek_formatted_abstract": "<b>Background:<\/b><br \/>Physical inactivity is a global concern, but diverse physical activity measures in use prevent international comparisons. The International Physical Activity Questionnaire (IPAQ) was developed as an instrument for cross-national monitoring of physical activity and inactivity. <br \/><br \/><b>Methods:<\/b><br \/>Between 1997 and 1998, an International Consensus Group developed four long and four short forms of the IPAQ instruments (administered by telephone interview or self-administration, with two alternate reference periods, either the last 7 d or a usual week of recalled physical activity). During 2000, 14 centers from 12 countries collected reliability and\/or validity data on at least two of the eight IPAQ instruments. Test-retest repeatability was assessed within the same week. Concurrent (inter-method) validity was assessed at the same administration, and criterion IPAQ validity was assessed against the CSA (now MTI) accelerometer. Spearman's correlation coefficients are reported, based on the total reported physical activity. <b><br \/><br \/>Results:<\/b> <br \/>Overall, the IPAQ questionnaires produced repeatable data (Spearman's p clustered around 0.8), with comparable data from short and long forms. Criterion validity had a median p of about 0.30, which was comparable to most other self-report validation studies. The usual week and last 7 d reference periods performed similarly, and the reliability of telephone administration was similar to the self-administered mode. <b><br \/><br \/>Conclusions:<\/b> <br \/>The IPAQ instruments have acceptable measurement properties, at least as good as other established self-reports. Considering the diverse samples in this study, IPAQ has reasonable measurement properties for monitoring population levels of physical activity among 18- to 65-yr-old adults in diverse settings. The short IPAQ form last 7 d recall is recommended for national monitoring and the long form for research requiring more detailed assessment.<br \/>",
