        "rek_formatted_title_xsdmf_id": null,
        "rek_formatted_title": null,
        "rek_formatted_abstract_xsdmf_id": 11442,
        "rek_formatted_abstract": "This tutorial review provides a brief summary of recent research progress on carbon-based electrode materials for supercapacitors, as well as the importance of electrolytes in the development of supercapacitor technology. The basic principles of supercapacitors, the characteristics and performances of various nanostructured carbon-based electrode materials are discussed. Aqueous and non-aqueous electrolyte solutions used in supercapacitors are compared. The trend on future development of high-power and high-energy supercapacitors is analyzed.<br \/>",
