        "rek_formatted_abstract": "<strong>Background<\/strong><br \/>Improving survival and extending the longevity of life for all populations requires timely, robust evidence on local mortality levels and trends. The Global Burden of Disease 2015 Study (GBD 2015) provides a comprehensive assessment of all-cause and cause-specific mortality for 249 causes in 195 countries and territories from 1980 to 2015. These results informed an in-depth investigation of observed and expected mortality patterns based on sociodemographic measures.<br \/><br \/><strong>Methods<\/strong><br \/>We estimated all-cause mortality by age, sex, geography, and year using an improved analytical approach originally developed for GBD 2013 and GBD 2010. Improvements included refinements to the estimation of child and adult mortality and corresponding uncertainty, parameter selection for under-5 mortality synthesis by spatiotemporal Gaussian process regression, and sibling history data processing. We also expanded the database of vital registration, survey, and census data to 14\u2008294 geography&ndash;year datapoints. For GBD 2015, eight causes, including Ebola virus disease, were added to the previous GBD cause list for mortality. We used six modelling approaches to assess cause-specific mortality, with the Cause of Death Ensemble Model (CODEm) generating estimates for most causes. We used a series of novel analyses to systematically quantify the drivers of trends in mortality across geographies. First, we assessed observed and expected levels and trends of cause-specific mortality as they relate to the Socio-demographic Index (SDI), a summary indicator derived from measures of income per capita, educational attainment, and fertility. Second, we examined factors affecting total mortality patterns through a series of counterfactual scenarios, testing the magnitude by which population growth, population age structures, and epidemiological changes contributed to shifts in mortality. Finally, we attributed changes in life expectancy to changes in cause of death. We documented each step of the GBD 2015 estimation processes, as well as data sources, in accordance with Guidelines for Accurate and Transparent Health Estimates Reporting (GATHER).<br \/><br \/><strong>Findings<br \/><\/strong>Globally, life expectancy from birth increased from 61&middot;7 years (95% uncertainty interval 61&middot;4&ndash;61&middot;9) in 1980 to 71&middot;8 years (71&middot;5&ndash;72&middot;2) in 2015. Several countries in sub-Saharan Africa had very large gains in life expectancy from 2005 to 2015, rebounding from an era of exceedingly high loss of life due to HIV\/AIDS. At the same time, many geographies saw life expectancy stagnate or decline, particularly for men and in countries with rising mortality from war or interpersonal violence. From 2005 to 2015, male life expectancy in Syria dropped by 11&middot;3 years (3&middot;7&ndash;17&middot;4), to 62&middot;6 years (56&middot;5&ndash;70&middot;2). Total deaths increased by 4&middot;1% (2&middot;6&ndash;5&middot;6) from 2005 to 2015, rising to 55&middot;8 million (54&middot;9 million to 56&middot;6 million) in 2015, but age-standardised death rates fell by 17&middot;0% (15&middot;8&ndash;18&middot;1) during this time, underscoring changes in population growth and shifts in global age structures. The result was similar for non-communicable diseases (NCDs), with total deaths from these causes increasing by 14&middot;1% (12&middot;6&ndash;16&middot;0) to 39&middot;8 million (39&middot;2 million to 40&middot;5 million) in 2015, whereas age-standardised rates decreased by 13&middot;1% (11&middot;9&ndash;14&middot;3). Globally, this mortality pattern emerged for several NCDs, including several types of cancer, ischaemic heart disease, cirrhosis, and Alzheimer's disease and other dementias. By contrast, both total deaths and age-standardised death rates due to communicable, maternal, neonatal, and nutritional conditions significantly declined from 2005 to 2015, gains largely attributable to decreases in mortality rates due to HIV\/AIDS (42&middot;1%, 39&middot;1&ndash;44&middot;6), malaria (43&middot;1%, 34&middot;7&ndash;51&middot;8), neonatal preterm birth complications (29&middot;8%, 24&middot;8&ndash;34&middot;9), and maternal disorders (29&middot;1%, 19&middot;3&ndash;37&middot;1). Progress was slower for several causes, such as lower respiratory infections and nutritional deficiencies, whereas deaths increased for others, including dengue and drug use disorders. Age-standardised death rates due to injuries significantly declined from 2005 to 2015, yet interpersonal violence and war claimed increasingly more lives in some regions, particularly in the Middle East. In 2015, rotaviral enteritis (rotavirus) was the leading cause of under-5 deaths due to diarrhoea (146\u2008000 deaths, 118\u2008000&ndash;183\u2008000) and pneumococcal pneumonia was the leading cause of under-5 deaths due to lower respiratory infections (393\u2008000 deaths, 228\u2008000&ndash;532\u2008000), although pathogen-specific mortality varied by region. Globally, the effects of population growth, ageing, and changes in age-standardised death rates substantially differed by cause. Our analyses on the expected associations between cause-specific mortality and SDI show the regular shifts in cause of death composition and population age structure with rising SDI. Country patterns of premature mortality (measured as years of life lost [YLLs]) and how they differ from the level expected on the basis of SDI alone revealed distinct but highly heterogeneous patterns by region and country or territory. Ischaemic heart disease, stroke, and diabetes were among the leading causes of YLLs in most regions, but in many cases, intraregional results sharply diverged for ratios of observed and expected YLLs based on SDI. Communicable, maternal, neonatal, and nutritional diseases caused the most YLLs throughout sub-Saharan Africa, with observed YLLs far exceeding expected YLLs for countries in which malaria or HIV\/AIDS remained the leading causes of early death.<br \/><br \/><strong>Interpretation<br \/><\/strong>At the global scale, age-specific mortality has steadily improved over the past 35 years; this pattern of general progress continued in the past decade. Progress has been faster in most countries than expected on the basis of development measured by the SDI. Against this background of progress, some countries have seen falls in life expectancy, and age-standardised death rates for some causes are increasing. Despite progress in reducing age-standardised death rates, population growth and ageing mean that the number of deaths from most non-communicable causes are increasing in most countries, putting increased demands on health systems.",
