        "rek_formatted_abstract_xsdmf_id": 11442,
        "rek_formatted_abstract": "<b>Summary:<\/b> The two main functions of bioinformatics are the<br \/>organization and analysis of biological data using computational<br \/>resources. Geneious Basic has been designed to be an easyto-<br \/>use and flexible desktop software application framework for<br \/>the organization and analysis of biological data, with a focus<br \/>on molecular sequences and related data types. It integrates<br \/>numerous industry-standard discovery analysis tools, with interactive<br \/>visualizations to generate publication-ready images. One key<br \/>contribution to researchers in the life sciences is the Geneious public<br \/>application programming interface (API) that affords the ability to<br \/>leverage the existing framework of the Geneious Basic software<br \/>platform for virtually unlimited extension and customization. The<br \/>result is an increase in the speed and quality of development of<br \/>computation tools for the life sciences, due to the functionality<br \/>and graphical user interface available to the developer through the<br \/>public API. Geneious Basic represents an ideal platform for the<br \/>bioinformatics community to leverage existing components and to<br \/>integrate their own specific requirements for the discovery, analysis<br \/>and visualization of biological data.<br \/><b>Availability and implementation:<\/b> Binaries and public API<br \/>freely available for download at http:\/\/www.geneious.com\/basic,<br \/>implemented in Java and supported on Linux, Apple OSX and MS<br \/>Windows. The software is also available from the Bio-Linux package<br \/>repository at http:\/\/nebc.nerc.ac.uk\/news\/geneiousonbl.",
