        "rek_pid": "UQ:368606",
        "rek_title_xsdmf_id": 10588,
        "rek_title": "De novo assembly of human genomes with massively parallel short read sequencing",
        "rek_description_xsdmf_id": 11441,
        "rek_description": "Next-generation massively parallel DNA sequencing technologies provide ultrahigh throughput at a substantially lower unit data cost; however, the data are very short read length sequences, making de novo assembly extremely challenging. Here, we describe a novel method for de novo assembly of large genomes from short read sequences. We successfully assembled both the Asian and African human genome sequences, achieving an N50 contig size of 7.4 and 5.9 kilobases (kb) and scaffold of 446.3 and 61.9 kb, respectively. The development of this de novo short read assembly method creates new opportunities for building reference sequences and carrying out accurate analyses of unexplored genomes in a cost-effective way.",
