        "rek_pid": "UQ:79446",
        "rek_title_xsdmf_id": 10588,
        "rek_title": "Greengenes, a chimera-checked 16S rRNA gene database and workbench compatible with ARB",
        "rek_description_xsdmf_id": 11441,
        "rek_description": "A 16S rRNA gene database (http:\/\/greengenes.bl.gov) addresses limitations of public repositories by providing chimera screening, standard alignment, and taxonomic classification using multiple published taxonomies. It was found that there is incongruent taxonomic nomenclature among curators even at the phylum level. Putative chimeras were identified in 3% of environmental sequences and in 0.2% of records derived from isolates. Environmental sequences were classified into 100 phylum-level lineages in the Archaea and Bacteria.",
