        "rek_citation": "<a class=\"citation_author_name\" title=\"Browse by Author Name for Patel, A.\" href=\"\/list\/author\/Patel%2C+A.\/\">Patel, A.<\/a>, <a class=\"citation_author_name\" title=\"Browse by Author Name for MacMahon, S.\" href=\"\/list\/author\/MacMahon%2C+S.\/\">MacMahon, S.<\/a>, <a class=\"citation_author_name\" title=\"Browse by Author Name for Chalmers, J.\" href=\"\/list\/author\/Chalmers%2C+J.\/\">Chalmers, J.<\/a>, <a class=\"citation_author_name\" title=\"Browse by Author Name for Neal, B.\" href=\"\/list\/author\/Neal%2C+B.\/\">Neal, B.<\/a>, <a class=\"citation_author_name\" title=\"Browse by Author Name for Billot, L.\" href=\"\/list\/author\/Billot%2C+L.\/\">Billot, L.<\/a>, <a class=\"citation_author_name\" title=\"Browse by Author Name for Woodward, M.\" href=\"\/list\/author\/Woodward%2C+M.\/\">Woodward, M.<\/a>, <a class=\"citation_author_name\" title=\"Browse by Author Name for Marre, M.\" href=\"\/list\/author\/Marre%2C+M.\/\">Marre, M.<\/a>, <a class=\"citation_author_name\" title=\"Browse by Author Name for Cooper, M.\" href=\"\/list\/author\/Cooper%2C+M.\/\">Cooper, M.<\/a>, <a class=\"author_id_link\" title=\"Browse by Author ID for Glasziou, P.\" href=\"\/list\/author_id\/421\/\">Glasziou, P.<\/a>, <a class=\"citation_author_name\" title=\"Browse by Author Name for Grobbee, D.\" href=\"\/list\/author\/Grobbee%2C+D.\/\">Grobbee, D.<\/a>, <a class=\"citation_author_name\" title=\"Browse by Author Name for Hamet, P.\" href=\"\/list\/author\/Hamet%2C+P.\/\">Hamet, P.<\/a>, <a class=\"citation_author_name\" title=\"Browse by Author Name for Harrap, S.\" href=\"\/list\/author\/Harrap%2C+S.\/\">Harrap, S.<\/a>, <a class=\"citation_author_name\" title=\"Browse by Author Name for Heller, S.\" href=\"\/list\/author\/Heller%2C+S.\/\">Heller, S.<\/a>, <a class=\"citation_author_name\" title=\"Browse by Author Name for Liu, L. S.\" href=\"\/list\/author\/Liu%2C+L.+S.\/\">Liu, L. S.<\/a>, <a class=\"citation_author_name\" title=\"Browse by Author Name for Mancia, G.\" href=\"\/list\/author\/Mancia%2C+G.\/\">Mancia, G.<\/a>, <a class=\"citation_author_name\" title=\"Browse by Author Name for Mogensen, C. E.\" href=\"\/list\/author\/Mogensen%2C+C.+E.\/\">Mogensen, C. E.<\/a>, <a class=\"citation_author_name\" title=\"Browse by Author Name for Pan, C. Y.\" href=\"\/list\/author\/Pan%2C+C.+Y.\/\">Pan, C. Y.<\/a>, <a class=\"citation_author_name\" title=\"Browse by Author Name for Poulter, N.\" href=\"\/list\/author\/Poulter%2C+N.\/\">Poulter, N.<\/a>, <a class=\"citation_author_name\" title=\"Browse by Author Name for Rodgers, A.\" href=\"\/list\/author\/Rodgers%2C+A.\/\">Rodgers, A.<\/a>, <a class=\"citation_author_name\" title=\"Browse by Author Name for Williams, B.\" href=\"\/list\/author\/Williams%2C+B.\/\">Williams, B.<\/a>, <a class=\"citation_author_name\" title=\"Browse by Author Name for Bompoint, S.\" href=\"\/list\/author\/Bompoint%2C+S.\/\">Bompoint, S.<\/a>, <a class=\"citation_author_name\" title=\"Browse by Author Name for de Galan, B. E.\" href=\"\/list\/author\/de+Galan%2C+B.+E.\/\">de Galan, B. E.<\/a>, <a class=\"citation_author_name\" title=\"Browse by Author Name for Joshi, R.\" href=\"\/list\/author\/Joshi%2C+R.\/\">Joshi, R.<\/a>, <a class=\"citation_author_name\" title=\"Browse by Author Name for Travert, F.\" href=\"\/list\/author\/Travert%2C+F.\/\">Travert, F.<\/a>, <a class=\"citation_author_name\" title=\"Browse by Author Name for The ADVANCE Collaborative Group\" href=\"\/list\/author\/The+ADVANCE+Collaborative+Group\/\">The ADVANCE Collaborative Group<\/a> and <a class=\"author_id_link\" title=\"Browse by Author ID for Fassett, R.\" href=\"\/list\/author_id\/77031\/\">Fassett, R.<\/a> (<span class=\"citation_date\">2008<\/span>) <a class=\"citation_title\" title=\"Click to view Journal Article: Intensive blood glucose control and vascular outcomes in patients with type 2 diabetes\" href=\"\/view\/UQ:182854\">Intensive blood glucose control and vascular outcomes in patients with type 2 diabetes<\/a>. <i><span class=\"citation_journal_name\">New England Journal of Medicine<\/span><\/i>, <i><span class=\"citation_volume_number\">358<\/span><\/i> <span class=\"citation_issue_number\">24<\/span>: <span class=\"citation_start_page\">2560<\/span>-<span class=\"citation_end_page\">2572<\/span>. doi:<span class=\"citation_doi\">10.1056\/NEJMoa0802987<\/span>",
        "rek_genre_xsdmf_id": 7207,
        "rek_genre": "Journal Article",
        "rek_genre_type_xsdmf_id": null,
