        "rek_formatted_title_xsdmf_id": null,
        "rek_formatted_title": null,
        "rek_formatted_abstract_xsdmf_id": 11442,
        "rek_formatted_abstract": "<p><font face=\"arial, helvetica\"><i>Background<\/i>&nbsp;In patients with type 2 diabetes, the effects of<sup>&nbsp;<\/sup>intensive glucose control on vascular outcomes remain uncertain.<\/font><\/p><font face=\"arial, helvetica\"><p><i>Methods<\/i>&nbsp;We randomly assigned 11,140 patients with type 2 diabetes<sup>&nbsp;<\/sup>to undergo either standard glucose control or intensive glucose<sup>&nbsp;<\/sup>control, defined as the use of gliclazide (modified release)<sup>&nbsp;<\/sup>plus other drugs as required to achieve a glycated hemoglobin<sup>&nbsp;<\/sup>value of 6.5% or less. Primary end points were composites of<sup>&nbsp;<\/sup>major macrovascular events (death from cardiovascular causes,<sup>&nbsp;<\/sup>nonfatal myocardial infarction, or nonfatal stroke) and major<sup>&nbsp;<\/sup>microvascular events (new or worsening nephropathy or retinopathy),<sup>&nbsp;<\/sup>assessed both jointly and separately.<\/p><p><i>Results<\/i>&nbsp;After a median of 5 years of follow-up, the mean glycated<sup>&nbsp;<\/sup>hemoglobin level was lower in the intensive-control group (6.5%)<sup>&nbsp;<\/sup>than in the standard-control group (7.3%). Intensive control<sup>&nbsp;<\/sup>reduced the incidence of combined major macrovascular and microvascular<sup>&nbsp;<\/sup>events (18.1%, vs. 20.0% with standard control; hazard ratio,<sup>&nbsp;<\/sup>0.90; 95% confidence interval [CI], 0.82 to 0.98; P=0.01), as<sup>&nbsp;<\/sup>well as that of major microvascular events (9.4% vs. 10.9%;<sup>&nbsp;<\/sup>hazard ratio, 0.86; 95% CI, 0.77 to 0.97; P=0.01), primarily<sup>&nbsp;<\/sup>because of a reduction in the incidence of nephropathy (4.1%<sup>&nbsp;<\/sup>vs. 5.2%; hazard ratio, 0.79; 95% CI, 0.66 to 0.93; P=0.006),<sup>&nbsp;<\/sup>with no significant effect on retinopathy (P=0.50). There were<sup>&nbsp;<\/sup>no significant effects of the type of glucose control on major<sup>&nbsp;<\/sup>macrovascular events (hazard ratio with intensive control, 0.94;<sup>&nbsp;<\/sup>95% CI, 0.84 to 1.06; P=0.32), death from cardiovascular causes<sup>&nbsp;<\/sup>(hazard ratio with intensive control, 0.88; 95% CI, 0.74 to<sup>&nbsp;<\/sup>1.04; P=0.12), or death from any cause (hazard ratio with intensive<sup>&nbsp;<\/sup>control, 0.93; 95% CI, 0.83 to 1.06; P=0.28). Severe hypoglycemia,<sup>&nbsp;<\/sup>although uncommon, was more common in the intensive-control<sup>&nbsp;<\/sup>group (2.7%, vs. 1.5% in the standard-control group; hazard<sup>&nbsp;<\/sup>ratio, 1.86; 95% CI, 1.42 to 2.40; P&lt;0.001).<\/p><\/font><i>Conclusions<\/i>&nbsp;A strategy of intensive glucose control, involving<sup>&nbsp;<\/sup>gliclazide (modified release) and other drugs as required, that<sup>&nbsp;<\/sup>lowered the glycated hemoglobin value to 6.5% yielded a 10%<sup>&nbsp;<\/sup>relative reduction in the combined outcome of major macrovascular<sup>&nbsp;<\/sup>and microvascular events, primarily as a consequence of a 21%<sup>&nbsp;<\/sup>relative reduction in nephropathy. (ClinicalTrials.gov number,<sup>&nbsp;<\/sup>NCT00145925&nbsp;",
