        "rek_herdc_notes": "Appendix bylines:<br \/>The members of the Writing Committee of the Action in Diabetes and Vascular Disease: Preterax and Diamicron Modified Release Controlled Evaluation (ADVANCE) Collaborative Group (Anushka Patel, M.D., Ph.D., Stephen MacMahon, D.Sc., Ph.D., John Chalmers, M.D., Ph.D., Bruce Neal, M.D., Ph.D., and Laurent Billot, M.Sc., the George Institute for International Health and University of Sydney, Sydney; Mark Woodward, Ph.D., the George Institute for International Health and University of Sydney, Sydney, and Mount Sinai School of Medicine, New York; Michel Marre, M.D., Ph.D., H&ocirc;pital Bichat&ndash;Claude Bernard and Universit&eacute; Paris 7, Paris; Mark Cooper, M.D., Ph.D., Baker Heart Research Institute, Melbourne, Australia;<b> Paul Glasziou, M.D., Ph.D., University of Oxford, Oxford, United Kingdom, and University of Queenland<\/b>, <b>Brisbane, Australia<\/b>; Diederick Grobbee, M.D., Ph.D., Julius Center for Health Sciences and Primary Care, University Medical Center Utrecht, Utrecht, the Netherlands; Pavel Hamet, M.D., Ph.D., Centre Hospitalier de l&rsquo;Universit&eacute; de Montreal and Universit&eacute; de Montreal, Montreal; Stephen Harrap, M.D., Ph.D., University of Melbourne and Royal Melbourne Hospital, Melbourne, Australia; Simon Heller, M.D., University of Sheffield and Sheffield Teaching Hospitals National Health Service (NHS)&nbsp; Foundation Trust, Sheffield, United Kingdom, Lisheng Liu, M.D., Chinese Hypertension League Institute, Beijing; Giuseppe Mancia, M.D., Ph.D., University of Milan&ndash;Bicocca and San Gerardo Hospital, Milan; Carl Erik Mogensen, M.D., Medical Department M, Aarhus<br \/>Sygehus, Aarhus, Denmark; Changyu Pan, M.D., Chinese People&rsquo;s Liberation Army General Hospital, Beijing; Neil Poulter, M.D., Imperial College and St. Mary&rsquo;s Hospital, London; Anthony Rodgers, M.D., Ph.D., Clinical Trials Research Unit and University of Auckland, Auckland, New Zealand; Bryan Williams, M.D., Ph.D., University of Leicester School of Medicine and Leicester Royal Infirmary, Leicester, United Kingdom; Severine Bompoint, B.Sc., the George Institute for International Health, Sydney; Bastiaan E. de Galan, M.D., Ph.D., the George Institute for International Health, Sydney, and Radboud University Nijmegen Medical Centre, Nijmegen, the Netherlands; Rohina Joshi, M.D., Ph.D., the George Institute for International Health and University of Sydney, Sydney; and Florence Travert, M.D., H&ocirc;pital Bichat&ndash;Claude Bernard and Universit&eacute; Paris 7, Paris) assume responsibility for the overall content and integrity of the article.<br \/><br \/><b>25\/1\/12 eSpace Ds. Note: Robert Fassett is not listed in the published bylines above. He is listed in the Supplementary Appendix which has the full listing of The ADVANCE Collaborative Group. Fassett is not affiliated with UQ in this listing - under Local Clinics: &quot;R Fassett, (Launceston General Hospital)&quot;<\/b><br \/><br \/>Supplementary Appendix URL: http:\/\/www.nejm.org\/doi\/suppl\/10.1056\/NEJMoa0802987\/suppl_file\/nejm_advance_2560sa1.pdf<br \/><br \/>",
